import React from 'react'
import briefcase from '../Assets/icons/Icons';


const Sidebar = () => {
  return (
    <div className='sidebar w-1/6'>
      <div>
        <img src={briefcase}/>
      </div>

    </div>
  )
}

export default Sidebar
